import AppBar from '@mui/material/AppBar';
import logo from './images/EZR.png';
import './App.css';

function App() {
  return (
    <AppBar position="static">    
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />


      </header>
    </div>
    </AppBar>

  );
}

export default App;
